webpackJsonp([0x9efb240e0f3b],{554:function(e,t){e.exports={data:{markdownRemark:{html:"<p>Are you screaming in silence every time you deploy your Gatsby blog because your custom URL has to be manually reset in Github Pages?</p>\n<p>I got you fam.</p>\n<p>In the root of your project folder, create a directory called 'static'.</p>\n<p>In that folder, create a file, call it 'CNAME' in caps with no file extension.</p>\n<p>In your favorite text editor, open CNAME and type in the domain name and TLD. For example, for my site, the entire file contents are</p>\n<pre><code>russellschmidt.net\n</code></pre>\n<p>That's it.</p>\n<p><img src=\"https://memegenerator.net/img/instances/54167426/its-so-easy-even-your-kids-can-do-it.jpg\" alt=\"Billy Mays saying it&#x27;s so easy even your kids can do it\"></p>",frontmatter:{date:"February 10, 2018",path:"/blog/custom-url-github-pages/",title:"Custom URL with Github Pages and Gatsby",type:"blog"}}},pathContext:{}}}});
